import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1> Hello world ❤️ </h1>
      <input />
      <button> Add Todo</button>

      <ul>
        <li>Take Dogs for a walk</li>
        <li>Take the garbage out</li>
      </ul>
    </div>
  );
}

export default App;
